import {useContext } from "react";
import WeatherContext from '../context/Weather.context'

function Place() {
  const {place} = useContext(WeatherContext)
  return (
    <div className="Place">
      <i class="bi bi-geo-alt"></i> <b>{place.name}</b>,
      <b>{place.country}</b>
    </div>
  );
}

export default Place;
